import React from 'react';
interface props {
    totalBooks: number;
    booksPerPage: number;
}
export const PaginationBooks = ({ totalBooks, booksPerPage }: props) => {
    let pages = [];

    for (let i = 1; i <= Math.ceil(totalBooks / booksPerPage); i++) {
        pages.push(i);
    }
    console.log(pages);
    return <div>Pagination</div>;
};
